import React from "react";
//5. Create a Note.jsx component to show a <div> element with a<h1> for a title and a <p> for the content?


var title = "Example Title";
var content  ="Example Content";



const Note = ({ title, content }) => {
    return (
      <div>
        <h1>{title}</h1>
        <p>{content}</p>
      </div>
    );
  };

export default Note;
